import React, { Component } from 'react';
import Cart from './Cart';



class NavBar extends Component {
  constructor(props) {
    super(props);

  }
     
  render() {
    return (
        <div><li>Hello World</li><Cart /></div>
        );
  };
};

export default NavBar;
